g alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/search" class="extiw" title="wiktionary:search">search</a></b></i>&#160;or <i><b><a href="https://en.wiktionary.org/wiki/searching" class="extiw" title="wiktionary:searching">searching</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <div role="note" class="hatnote navigation-not-searchable"><span class="plainlinks selfreference noprint">To <a href="/wiki/Help:Searching" title="Help:Searching">search Wikipedia</a>, go to <a href="/wiki/Special:Search" title="Special:Search">Special:Search</a>.</span></div> <p><b>Searching</b> or <b>search</b> may refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Computing_technology"><span class="tocnumber">1</span> <span class="toctext">Computing technology</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Arts_and_entertainment"><span class="tocnumber">2</span> <span class="toctext">Arts and entertainment</span></a> <ul> <li class="toclevel-2 tocsection-3"><a href="#Music"><span class="tocnumber">2.1</span> <span class="toctext">Music</span></a></li> <li class="toclevel-2 tocsection-4"><a href="#Other_media"><span class="tocnumber">2.2</span> <span class="toctext">Other media</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-5"><a href="#Organizations"><span class="tocnumber">3</span> <span class="toctext">Organizations</span></a></li> <li class="toclevel-1 tocsection-6"><a href="#Other_uses"><span class="tocnumber">4</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-7"><a href="#See_also"><span class="tocnumber">5</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Computing_technology">Computing technology</span></h2> <ul> <li><a href="/wiki/Search_algorithm" title="Search algorithm">Search algorithm</a>, including keyword search <ul> <li><a href="/wiki/Category:Search_algorithms" title="Category:Search algorithms">Category:Search algorithms</a></li> </ul> </li> <li><a href="/wiki/Search_engine_technology" title="Search engine technology">Search engine technology</a>, software for finding information <ul> <li><a href="/wiki/Web_search_engine" title="Web search engine">Web search engine</a>, a service for finding information on the World Wide Web</li> <li><a href="/wiki/Enterprise_search" title="Enterprise search">Enterprise search</a>, software or services for finding information within organizations</li> </ul> </li> <li><a href="/wiki/Search_and_optimization" class="mw-redirect" title="Search and optimization">Search and optimization</a> for problem solving in Artificial Intelligence</li> </ul> <h2><span class="mw-headline" id="Arts_and_entertainment">Arts and entertainment</span></h2> <h3><span class="mw-headline" id="Music">Music</span></h3> <ul> <li><a href="/wiki/Search_(band)" title="Search (band)">Search (band)</a>, a Malaysian rock band</li> <li>"<a href="/wiki/Searchin%27" title="Searchin'">Searchin'</a>", a 1957 song originally performed by The Coasters</li> <li><a href="/wiki/Searchin%27_(CeCe_Peniston_song)" title="Searchin' (CeCe Peniston song)">"Searchin'" (CeCe Peniston song)</a>, a 1993 song by CeCe Peniston</li> <li>"<a href="/wiki/Searchin%27_(I_Gotta_Find_a_Man)" title="Searchin' (I Gotta Find a Man)">Searchin' (I Gotta Find a Man)</a>", a 1983 dance song by Hazell Dean</li> <li><a href="/wiki/Searching_(INXS_song)" title="Searching (INXS song)">"Searching" (INXS song)</a>, a 1997 song by INXS</li> <li>"Searching", a 2013 album by <a href="/wiki/Jay_Diggins" title="Jay Diggins">Jay Diggins</a></li> <li>"Searching", a 1980 single by <a href="/wiki/Change_(band)" title="Change (band)">Change</a></li> <li>"Searching", a 1990s song by <a href="/wiki/China_Black" title="China Black">China Black</a></li> <li>"Searching", a song by <a href="/wiki/Joe_Satriani" title="Joe Satriani">Joe Satriani</a></li> <li>"Searchin'", a 1981 song on the Blackfoot album <a href="/wiki/Marauder_(Blackfoot_album)" title="Marauder (Blackfoot album)"><i>Marauder</i></a></li> <li>"Searching", a 1976 song by Lynyrd Skynyrd from the album <i><a href="/wiki/Gimme_Back_My_Bullets" title="Gimme Back My Bullets">Gimme Back My Bullets</a></i></li> </ul> <h3><span class="mw-headline" id="Other_media">Other media</span></h3> <ul> <li><a href="/wiki/Search_(TV_series)" title="Search (TV series)"><i>Search</i> (TV series)</a>, a television series</li> <li><a href="/wiki/Searching_(Desperate_Housewives)" title="Searching (Desperate Housewives)">"Searching" (<i>Desperate Housewives</i>)</a>, a 2011 TV episode of <i>Desperate Housewives</i></li> <li>"The Search", the third episode of the 1965 <i>Doctor Who</i> serial <i><a href="/wiki/The_Space_Museum#Production" title="The Space Museum">The Space Museum</a></i></li> </ul> <h2><span class="mw-headline" id="Organizations">Organizations</span></h2> <ul> <li><a href="/wiki/Study_of_Environmental_Arctic_Change" title="Study of Environmental Arctic Change">Study of Environmental Arctic Change</a>, a research program</li> <li><a href="/wiki/Society_for_Education_Action_and_Research_in_Community_Health" class="mw-redirect" title="Society for Education Action and Research in Community Health">Society for Education Action and Research in Community Health</a>, a non-governmental organization in Maharashtra, India</li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span></h2> <ul> <li><a href="/wiki/Search_and_rescue" title="Search and rescue">Search and rescue</a></li> <li><a href="/wiki/Search_and_seizure" title="Search and seizure">Search and seizure</a>, a police procedure</li> <li><a href="/wiki/Searching_(horse)" title="Searching (horse)">Searching (horse)</a> (1952–1973), a racehorse</li> <li><a href="/wiki/Bayesian_search_theory" title="Bayesian search theory">Bayesian search theory</a>, looking for a target</li> <li><a href="/wiki/Search_game" title="Search game">Search game</a>, in game theory</li> <li><a href="/wiki/Gay_Search" title="Gay Search">Gay Search</a>, a British television anchor and gardener</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span></h2> <ul> <li><span class="selfreference"><a href="/wiki/Special:PrefixIndex/search" title="Special:PrefixIndex/search">All pages beginning with "search"</a></span></li> <li><span class="selfreference"><a href="/wiki/Special:Search/intitle:%22search%22" title="Special:Search/intitle:&quot;search&quot;">All pages with a title containing <i>search</i></a></span></li> <li><a href="/wiki/Find_(disambiguation)" class="mw-redirect mw-disambig" title="Find (disambiguation)">Find (disambiguation)</a></li> <li><a href="/wiki/The_Search_(disambiguation)" class="mw-disambig" title="The Search (disambiguation)">The Search (disambiguation)</a></li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class="image"><img alt="Disambiguation icon" src="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/30px-Disambig_gray.svg.png" width="30" height="23" srcset="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/45px-Disambig_gray.svg.png 1.5x, //upload.